import React, { useEffect } from "react";
import Tmdb from './Tmdb';

export default () => {

  useEffect(()=>{
    const loadAll = async () => {
      // Pegando a lista total
      let list = await Tmdb.getHomeList();
      console.log(list);
    }

    loadAll();
  }, []);

  return (
    <div>
      Ola mundo!
    </div>
  );
}
